import React, { useState, useEffect } from 'react';
import axios from 'axios';
import {
    Card,
    CardHeader,
    ListGroup,
    ListGroupItem,
    Row,
    Col,
    Form,
    FormGroup,
    FormInput,
    FormSelect,
    FormTextarea,
    Button
} from "shards-react";
import { useLocation } from 'react-router-dom';

const AssignForm = () => {

    const location = useLocation();

    useEffect(() => {
        window.scrollTo(0, 0);
        allwriters();
    }, []);

    const [iswriter, setwriter] = useState([]);
    const allwriters = async (ids) => {
        try {
            // axios.get(`http://localhost:8000/essay-helpers/api/assignwriter.php`)
            axios.get(`https://graduate-essay-helpers.com/api/assignwriter.php`)
                .then(res => {
                    console.log(res.data.writerslist.writerdata)
                    setwriter(res.data.writerslist.writerdata);
                })
        } catch (error) { throw error; }
    };

    console.log(iswriter)
    console.log(location)

    return (
        <Card small className="mb-4">
            <CardHeader className="border-bottom">
                <h6 className="m-0">Assignment Form</h6>
            </CardHeader>
            <ListGroup flush>
                <ListGroupItem className="p-3">
                    <Row>
                        <Col>
                            <Form className="insertForm">
                                <FormGroup>
                                    <label htmlFor='title'>Title</label>
                                    <FormInput
                                        id="title"
                                        name="title"
                                        placeholder="Task title"
                                        value={location.state.rowIndex[0].title}
                                        style={{ fontWeight: '500', color: 'black' }}
                                    ></FormInput>
                                </FormGroup>
                                <FormGroup>
                                    <FormGroup>
                                        <label htmlFor="priority">Task priority:</label>
                                        <FormSelect
                                            style={{ fontWeight: '500', color: 'black' }}
                                        // size="md"
                                        >
                                            {/* <option value="first">Select ---</option> */}
                                            <option value="first">High</option>
                                            <option value="second">Medium</option>
                                            <option value="third">Low</option>
                                        </FormSelect>
                                    </FormGroup>
                                    <label htmlFor="assign">Assigned to:</label>
                                    <FormSelect
                                        style={{ fontWeight: '500', color: 'black' }}
                                    // size="md"
                                    >
                                        <option value="first">Select ---</option>
                                        {iswriter.map((writer, index) => (
                                            <>
                                                <option
                                                    key={writer.id}
                                                >{writer.name}</option>
                                            </>
                                        ))}

                                    </FormSelect>
                                </FormGroup>
                                <FormGroup>
                                    <label htmlFor="phone">Phone</label>
                                    <FormInput
                                        id="phone"
                                        name="phone"
                                        // type="number"
                                        placeholder="phone"
                                    // onChange={onChangeValue}
                                    />
                                </FormGroup>
                                <FormGroup>
                                    <label htmlFor="comp_email">Company Email</label>
                                    <FormInput
                                        id="comp_email"
                                        name="comp_email"
                                        placeholder="company email address"
                                    // onChange={onChangeValue}
                                    />
                                </FormGroup>
                                <Row form>
                                    <Col md="12" className="form-group">
                                        <label htmlFor="map">Map</label>
                                        <FormTextarea id="map" name="map" rows="4" />
                                    </Col>
                                </Row>
                                <FormGroup>
                                    <label htmlFor="ddress">Address with pincode</label>
                                    <FormInput
                                        id="address"
                                        name="address"
                                        placeholder="Address"
                                    // value=""
                                    // onChange={onChangeValue}
                                    />
                                </FormGroup>
                                <Button type="submit" theme="accent">Update</Button>
                            </Form>
                        </Col>
                    </Row>
                </ListGroupItem>
            </ListGroup>
        </Card>
    )
}

export default AssignForm
